import base64
from PIL import Image
import io

def strip_image_metadata(base64_str):
    # Remove prefix
    if "," in base64_str:
        header, base64_str = base64_str.split(",")

    # Decode
    img_data = base64.b64decode(base64_str)
    img = Image.open(io.BytesIO(img_data))

    # Save to buffer without metadata
    output = io.BytesIO()
    # By NOT passing 'exif=img.info.get("exif")', it is stripped automatically
    img.save(output, format="JPEG", optimize=True, quality=85)
    
    # Encode
    clean_base64 = base64.b64encode(output.getvalue()).decode('utf-8')
    return f"data:image/jpeg;base64,{clean_base64}"

print(strip_image_metadata("""
data:image/jpeg;base64,
"""))